import React, { Fragment } from 'react';

const Item = ({itemValue}) => {
    return (
        <Fragment>
        <div className='output-list-item'>
            <li className='li-item'>{itemValue} <button>Delete</button></li>
        </div>
        </Fragment>
    )
}

export default Item;
